import React from 'react';

class Weather extends React.Component {
    render() {
        return (
            <div>
                <p>{this.props.name}</p>
                <p>{this.props.temp}</p>
                <p>{this.props.humidity}</p>
                <p>{this.props.pressure}</p>
                <p>{this.props.error}</p>
            </div>
        )
    }
}

export default Weather;
